// –≠—Ç–∞ –ø—Ä–æ–≥—Ä–∞–º–º–∞ –ø–æ–∑–≤–æ–ª—è–µ—Ç –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—é —Ä–∞—Å—Å—á–∏—Ç–∞—Ç—å –∫—Ä–µ–¥–∏—Ç, –ø–æ—Å–º–æ—Ç—Ä–µ—Ç—å –∫—Ä–µ–¥–∏—Ç–Ω—ã–µ —Å—Ç–∞–≤–∫–∏ –∏ –ø—Ä–æ–≤–µ—Ä–∏—Ç—å, –±—É–¥–µ—Ç –ª–∏ –æ–¥–æ–±—Ä–µ–Ω –∫—Ä–µ–¥–∏—Ç

// –ò–º–ø–æ—Ä—Ç–∏—Ä—É–µ–º –Ω–µ–æ–±—Ö–æ–¥–∏–º—ã–µ –∫–ª–∞—Å—Å—ã –¥–ª—è —Ä–∞–±–æ—Ç—ã —Å –≤–≤–æ–¥–æ–º –¥–∞–Ω–Ω—ã—Ö –∏ —Ö—Ä–∞–Ω–µ–Ω–∏–µ–º –¥–∞–Ω–Ω—ã—Ö –≤ –≤–∏–¥–µ –ø–∞—Ä "–∫–ª—é—á-–∑–Ω–∞—á–µ–Ω–∏–µ"
import java.util.HashMap;
import java.util.Map;
import java.util.Scanner;

// –û–ø—Ä–µ–¥–µ–ª—è–µ–º –∫–ª–∞—Å—Å Credit –¥–ª—è —Ö—Ä–∞–Ω–µ–Ω–∏—è –∏–Ω—Ñ–æ—Ä–º–∞—Ü–∏–∏ –æ –∫—Ä–µ–¥–∏—Ç–µ
public class lab2_21 {
    static class Credit {
        // –û–±—ä—è–≤–ª—è–µ–º –ø–µ—Ä–µ–º–µ–Ω–Ω—ã–µ –¥–ª—è —Ö—Ä–∞–Ω–µ–Ω–∏—è —Å—É–º–º—ã, —Å—Ä–æ–∫–∞ –∏ –ø—Ä–æ—Ü–µ–Ω—Ç–Ω–æ–π —Å—Ç–∞–≤–∫–∏ –∫—Ä–µ–¥–∏—Ç–∞
        private double amount;
        private int term;
        private double rate;

        // –û–ø—Ä–µ–¥–µ–ª—è–µ–º –∫–æ–Ω—Å—Ç—Ä—É–∫—Ç–æ—Ä –¥–ª—è —Å–æ–∑–¥–∞–Ω–∏—è –æ–±—ä–µ–∫—Ç–∞ –∫–ª–∞—Å—Å–∞ Credit —Å –∑–∞–¥–∞–Ω–Ω—ã–º–∏ –ø–∞—Ä–∞–º–µ—Ç—Ä–∞–º–∏
        public Credit(double amount, int term, double rate) {
            this.amount = amount;
            this.term = term;
            this.rate = rate;
        }

        // –û–ø—Ä–µ–¥–µ–ª—è–µ–º –º–µ—Ç–æ–¥ –¥–ª—è —Ä–∞—Å—á–µ—Ç–∞ –µ–∂–µ–º–µ—Å—è—á–Ω–æ–≥–æ –ø–ª–∞—Ç–µ–∂–∞ –ø–æ –∫—Ä–µ–¥–∏—Ç—É
        public double getMonthlyPayment() {
            // –í—ã—á–∏—Å–ª—è–µ–º –º–µ—Å—è—á–Ω—É—é –ø—Ä–æ—Ü–µ–Ω—Ç–Ω—É—é —Å—Ç–∞–≤–∫—É –∏ –∫–æ—ç—Ñ—Ñ–∏—Ü–∏–µ–Ω—Ç –∞–Ω–Ω—É–∏—Ç–µ—Ç–Ω–æ–≥–æ –ø–ª–∞—Ç–µ–∂–∞
            double monthlyRate = rate / 100 / 12;
            double coefficient = (monthlyRate * Math.pow(1 + monthlyRate, term)) / (Math.pow(1 + monthlyRate, term) - 1);
            // –í–æ–∑–≤—Ä–∞—â–∞–µ–º –ø—Ä–æ–∏–∑–≤–µ–¥–µ–Ω–∏–µ —Å—É–º–º—ã –∫—Ä–µ–¥–∏—Ç–∞ –Ω–∞ –∫–æ—ç—Ñ—Ñ–∏—Ü–∏–µ–Ω—Ç –∞–Ω–Ω—É–∏—Ç–µ—Ç–Ω–æ–≥–æ –ø–ª–∞—Ç–µ–∂–∞
            return amount * coefficient;
        }

        // –û–ø—Ä–µ–¥–µ–ª—è–µ–º –º–µ—Ç–æ–¥ –¥–ª—è —Ä–∞—Å—á–µ—Ç–∞ –æ–±—â–µ–π —Å—É–º–º—ã –≤—ã–ø–ª–∞—Ç –ø–æ –∫—Ä–µ–¥–∏—Ç—É
        public double getTotalAmount() {
            // –í–æ–∑–≤—Ä–∞—â–∞–µ–º –ø—Ä–æ–∏–∑–≤–µ–¥–µ–Ω–∏–µ –µ–∂–µ–º–µ—Å—è—á–Ω–æ–≥–æ –ø–ª–∞—Ç–µ–∂–∞ –Ω–∞ —Å—Ä–æ–∫ –∫—Ä–µ–¥–∏—Ç–∞
            return getMonthlyPayment() * term;
        }

        // –û–ø—Ä–µ–¥–µ–ª—è–µ–º –º–µ—Ç–æ–¥ –¥–ª—è —Ä–∞—Å—á–µ—Ç–∞ –ø–µ—Ä–µ–ø–ª–∞—Ç—ã –ø–æ –∫—Ä–µ–¥–∏—Ç—É
        public double getOverpayment() {
            // –í–æ–∑–≤—Ä–∞—â–∞–µ–º —Ä–∞–∑–Ω–æ—Å—Ç—å –º–µ–∂–¥—É –æ–±—â–µ–π —Å—É–º–º–æ–π –≤—ã–ø–ª–∞—Ç –∏ —Å—É–º–º–æ–π –∫—Ä–µ–¥–∏—Ç–∞
            return getTotalAmount() - amount;
        }
    }

    // –û–ø—Ä–µ–¥–µ–ª—è–µ–º –∫–ª–∞—Å—Å CreditRate –¥–ª—è —Ö—Ä–∞–Ω–µ–Ω–∏—è –∏–Ω—Ñ–æ—Ä–º–∞—Ü–∏–∏ –æ –∫—Ä–µ–¥–∏—Ç–Ω–æ–π —Å—Ç–∞–≤–∫–µ
    static class CreditRate {
        // –û–±—ä—è–≤–ª—è–µ–º –ø–µ—Ä–µ–º–µ–Ω–Ω—ã–µ –¥–ª—è —Ö—Ä–∞–Ω–µ–Ω–∏—è —Å—É–º–º—ã, –ø—Ä–æ—Ü–µ–Ω—Ç–Ω–æ–π —Å—Ç–∞–≤–∫–∏ –∏ —Å—Ä–æ–∫–∞ –∫—Ä–µ–¥–∏—Ç–Ω–æ–π —Å—Ç–∞–≤–∫–∏
        private double amount;
        private double rate;
        private int months;

        // –û–ø—Ä–µ–¥–µ–ª—è–µ–º –∫–æ–Ω—Å—Ç—Ä—É–∫—Ç–æ—Ä –¥–ª—è —Å–æ–∑–¥–∞–Ω–∏—è –æ–±—ä–µ–∫—Ç–∞ –∫–ª–∞—Å—Å–∞ CreditRate —Å –∑–∞–¥–∞–Ω–Ω—ã–º–∏ –ø–∞—Ä–∞–º–µ—Ç—Ä–∞–º–∏
        public CreditRate(double amount, double rate, int months) {
            this.amount = amount;
            this.rate = rate;
            this.months = months;
        }

        // –û–ø—Ä–µ–¥–µ–ª—è–µ–º –º–µ—Ç–æ–¥—ã –¥–ª—è –ø–æ–ª—É—á–µ–Ω–∏—è –∑–Ω–∞—á–µ–Ω–∏–π –ø–µ—Ä–µ–º–µ–Ω–Ω—ã—Ö –∫–ª–∞—Å—Å–∞ CreditRate
        public double getAmount() {
            return amount;
        }

        public double getRate() {
            return rate;
        }

        public int getMonths() {
            return months;
        }
    }

    // –û–ø—Ä–µ–¥–µ–ª—è–µ–º –∫–ª–∞—Å—Å CreditCheck –¥–ª—è –ø—Ä–æ–≤–µ—Ä–∫–∏ –æ–¥–æ–±—Ä–µ–Ω–∏—è –∫—Ä–µ–¥–∏—Ç–∞
    static class CreditCheck {
        // –û–±—ä—è–≤–ª—è–µ–º –ø–µ—Ä–µ–º–µ–Ω–Ω—ã–µ –¥–ª—è —Ö—Ä–∞–Ω–µ–Ω–∏—è –¥–æ—Ö–æ–¥–∞, –≤—ã–ø–ª–∞—Ç –ø–æ –¥—Ä—É–≥–∏–º –∫—Ä–µ–¥–∏—Ç–∞–º –∏ –º–∞–∫—Å–∏–º–∞–ª—å–Ω–æ–≥–æ –ø—Ä–æ—Ü–µ–Ω—Ç–∞ –æ—Ç –¥–æ—Ö–æ–¥–∞, –∫–æ—Ç–æ—Ä—ã–π –≥–æ—Ç–æ–≤ —Ç—Ä–∞—Ç–∏—Ç—å –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—å
        private double income;
        private double otherPayments;
        private double maxPayment;

        // –û–ø—Ä–µ–¥–µ–ª—è–µ–º –∫–æ–Ω—Å—Ç—Ä—É–∫—Ç–æ—Ä –¥–ª—è —Å–æ–∑–¥–∞–Ω–∏—è –æ–±—ä–µ–∫—Ç–∞ –∫–ª–∞—Å—Å–∞ CreditCheck —Å –∑–∞–¥–∞–Ω–Ω—ã–º–∏ –ø–∞—Ä–∞–º–µ—Ç—Ä–∞–º–∏
        public CreditCheck(double income, double otherPayments, double maxPayment) {
            this.income = income;
            this.otherPayments = otherPayments;
            this.maxPayment = maxPayment;
        }

        // –û–ø—Ä–µ–¥–µ–ª—è–µ–º –º–µ—Ç–æ–¥ –¥–ª—è –ø—Ä–æ–≤–µ—Ä–∫–∏ –æ–¥–æ–±—Ä–µ–Ω–∏—è –∫—Ä–µ–¥–∏—Ç–∞
        public boolean isApproved(Credit credit) {
            // –í—ã—á–∏—Å–ª—è–µ–º –µ–∂–µ–º–µ—Å—è—á–Ω—ã–π –ø–ª–∞—Ç–µ–∂ –ø–æ –∫—Ä–µ–¥–∏—Ç—É –∏ –æ–±—â–∏–π –¥–æ—Ö–æ–¥ –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—è
            double monthlyPayment = credit.getMonthlyPayment();
            double totalIncome = income - otherPayments;
            // –í–æ–∑–≤—Ä–∞—â–∞–µ–º true, –µ—Å–ª–∏ –µ–∂–µ–º–µ—Å—è—á–Ω—ã–π –ø–ª–∞—Ç–µ–∂ –Ω–µ –ø—Ä–µ–≤—ã—à–∞–µ—Ç –º–∞–∫—Å–∏–º–∞–ª—å–Ω—ã–π –ø—Ä–æ—Ü–µ–Ω—Ç –æ—Ç –¥–æ—Ö–æ–¥–∞, –∏–Ω–∞—á–µ false
            return monthlyPayment <= totalIncome * maxPayment / 100;
        }

        // –û–ø—Ä–µ–¥–µ–ª—è–µ–º –º–µ—Ç–æ–¥ –¥–ª—è —Ä–∞—Å—á–µ—Ç–∞ –º–∞–∫—Å–∏–º–∞–ª—å–Ω–æ–π —Å—É–º–º—ã –∫—Ä–µ–¥–∏—Ç–∞, –∫–æ—Ç–æ—Ä—É—é –º–æ–∂–µ—Ç –≤–∑—è—Ç—å –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—å
        public double getMaxCreditAmount(int term, double rate) {
            // –í—ã—á–∏—Å–ª—è–µ–º –µ–∂–µ–º–µ—Å—è—á–Ω—ã–π –ø–ª–∞—Ç–µ–∂, –∫–æ—Ç–æ—Ä—ã–π –º–æ–∂–µ—Ç –ø–æ–∑–≤–æ–ª–∏—Ç—å —Å–µ–±–µ –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—å, –∏ –∫–æ—ç—Ñ—Ñ–∏—Ü–∏–µ–Ω—Ç –∞–Ω–Ω—É–∏—Ç–µ—Ç–Ω–æ–≥–æ –ø–ª–∞—Ç–µ–∂–∞
            double monthlyPayment = (income - otherPayments) * maxPayment / 100;
            double coefficient = (rate / 100 / 12) * Math.pow(1 + rate / 100 / 12, term) / (Math.pow(1 + rate / 100 / 12, term) - 1);
            // –í–æ–∑–≤—Ä–∞—â–∞–µ–º –º–∞–∫—Å–∏–º–∞–ª—å–Ω—É—é —Å—É–º–º—É –∫—Ä–µ–¥–∏—Ç–∞, –∫–æ—Ç–æ—Ä—É—é –º–æ–∂–µ—Ç –≤–∑—è—Ç—å –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—å
            return monthlyPayment / coefficient;
        }

        // –û–ø—Ä–µ–¥–µ–ª—è–µ–º –º–µ—Ç–æ–¥ –¥–ª—è –ø—Ä–æ–≤–µ—Ä–∫–∏ –≤–æ–∑–º–æ–∂–Ω–æ—Å—Ç–∏ –≤—ã–ø–ª–∞—Ç—ã –µ–∂–µ–º–µ—Å—è—á–Ω–æ–≥–æ –ø–ª–∞—Ç–µ–∂–∞
        public boolean canAffordMonthlyPayment(double monthlyPayment) {
            // –í—ã—á–∏—Å–ª—è–µ–º –æ–±—â–∏–π –¥–æ—Ö–æ–¥ –ø–æ–ª—å–∑–æ–≤–∞—Ç–µ–ª—è
            double totalIncome = income - otherPayments;
            // –í–æ–∑–≤—Ä–∞—â–∞–µ–º true, –µ—Å–ª–∏ –µ–∂–µ–º–µ—Å—è—á–Ω—ã–π –ø–ª–∞—Ç–µ–∂ –Ω–µ –ø—Ä–µ–≤—ã—à–∞–µ—Ç –º–∞–∫—Å–∏–º–∞–ª—å–Ω—ã–π –ø—Ä–æ—Ü–µ–Ω—Ç –æ—Ç –¥–æ—Ö–æ–¥–∞, –∏–Ω–∞—á–µ false
            return monthlyPayment <= totalIncome * maxPayment / 100;
        }

        // –û–ø—Ä–µ–¥–µ–ª—è–µ–º –º–µ—Ç–æ–¥ –¥–ª—è –ø—Ä–æ–≤–µ—Ä–∫–∏ –∫–æ—Ä—Ä–µ–∫—Ç–Ω–æ—Å—Ç–∏ –∑–Ω–∞—á–µ–Ω–∏—è –º–∞–∫—Å–∏–º–∞–ª—å–Ω–æ–≥–æ –ø—Ä–æ—Ü–µ–Ω—Ç–∞ –æ—Ç –¥–æ—Ö–æ–¥–∞
        public boolean isValidMaxPayment() {
            // –í–æ–∑–≤—Ä–∞—â–∞–µ–º true, –µ—Å–ª–∏ –º–∞–∫—Å–∏–º–∞–ª—å–Ω—ã–π –ø—Ä–æ—Ü–µ–Ω—Ç –æ—Ç –¥–æ—Ö–æ–¥–∞ –Ω–∞—Ö–æ–¥–∏—Ç—Å—è –≤ –¥–∏–∞–ø–∞–∑–æ–Ω–µ –æ—Ç 0 –¥–æ 100, –∏–Ω–∞—á–µ false
            return maxPayment <= 100 && maxPayment >= 0;
        }

        // –û–ø—Ä–µ–¥–µ–ª—è–µ–º –º–µ—Ç–æ–¥ –¥–ª—è –ø—Ä–æ–≤–µ—Ä–∫–∏ –∫–æ—Ä—Ä–µ–∫—Ç–Ω–æ—Å—Ç–∏ –∑–Ω–∞—á–µ–Ω–∏—è –¥–æ—Ö–æ–¥–∞
        public boolean isValidIncome() {
            // –í–æ–∑–≤—Ä–∞—â–∞–µ–º true, –µ—Å–ª–∏ –¥–æ—Ö–æ–¥ –Ω–µ –º–µ–Ω—å—à–µ –≤—ã–ø–ª–∞—Ç –ø–æ –¥—Ä—É–≥–∏–º –∫—Ä–µ–¥–∏—Ç–∞–º, –∏–Ω–∞—á–µ false
            return income >= otherPayments;
        }
    }

    // –û–ø—Ä–µ–¥–µ–ª—è–µ–º –≥–ª–∞–≤–Ω—ã–π –º–µ—Ç–æ–¥ –ø—Ä–æ–≥—Ä–∞–º–º—ã
    public static void main(String[] args) {
        // –°–æ–∑–¥–∞–µ–º –æ–±—ä–µ–∫—Ç –∫–ª–∞—Å—Å–∞ Scanner –¥–ª—è —á—Ç–µ–Ω–∏—è –¥–∞–Ω–Ω—ã—Ö —Å –∫–ª–∞–≤–∏–∞—Ç—É—Ä—ã
        Scanner scanner = new Scanner(System.in);

        // –û–±—ä—è–≤–ª—è–µ–º –ø–µ—Ä–µ–º–µ–Ω–Ω—É—é –¥–ª—è —É–ø—Ä–∞–≤–ª–µ–Ω–∏—è —Ü–∏–∫–ª–æ–º –ø—Ä–æ–≥—Ä–∞–º–º—ã
        boolean exit = false;
        while (!exit) {
            // –í—ã–≤–æ–¥–∏–º –º–µ–Ω—é –ø—Ä–æ–≥—Ä–∞–º–º—ã
            System.out.println("\n1. –†–∞—Å—á–∏—Ç–∞—Ç—å –∫—Ä–µ–¥–∏—Ç");
            System.out.println("2. –ö—Ä–µ–¥–∏—Ç–Ω—ã–µ —Å—Ç–∞–≤–∫–∏");
            System.out.println("3. –ü—Ä–æ–≤–µ—Ä–∏—Ç—å –æ–¥–æ–±—Ä–µ–Ω–∏–µ –∫—Ä–µ–¥–∏—Ç–∞");
            System.out.println("–í–∞—à –≤—ã–±–æ—Ä: ");
