import java.io.*;
import java.util.*;

public class Main {
    static int max(int[][] arr, int i, int j){
        int max = arr[i][j];
        for(int k = i; k < i + 3; k++){
            for(int l = j; l < j + 3; l++){
                max = Math.max(max, arr[k][l]);
            }
        }
        return max;
    }
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int[][] arr = new int[n][n];
        for(int i = 0; i < n; i++){
            for(int j = 0; j < n; j++){
                arr[i][j] = sc.nextInt();
            }
        }
        for(int i = 0; i < n - 2; i++){
            for(int j = 0; j < n - 2; j++){
                System.out.print(max(arr, i, j) + " ");
            }
            System.out.println();
        }
    }
}

