            int sum = 0;

            Console.WriteLine("–†–∞–Ω–¥–æ–º–Ω–æ–µ —á–∏—Å–ª–æ: " + number);

            for (int i = 1; i <= number; i++)
            {
                if (i % dividedNumber1 == 0 || i % dividedNumber2 == 0)
                {
